\tab `inscr_est` varchar(50) DEFAULT NULL,\par
\tab `endereco` varchar(50) DEFAULT NULL,\par
\tab `numero` varchar(50) DEFAULT NULL,\par
\tab `bairro` varchar(50) DEFAULT NULL,\par
\tab `complemento` varchar(50) DEFAULT NULL,\par
\tab `cep` varchar(50) DEFAULT NULL,\par
\tab `cidade` varchar(50) DEFAULT NULL,\par
\tab `estado` varchar(50) DEFAULT NULL,\par
\tab `telefone` varchar(50) DEFAULT NULL,\par
\tab `fax` varchar(50) DEFAULT NULL,\par
\tab `email` varchar(50) DEFAULT NULL,\par
\tab `site` varchar(50) DEFAULT NULL,\par
\tab `proprietario` varchar(50) DEFAULT NULL,\par
\tab `cpf` varchar(50) DEFAULT NULL,\par
\tab `rg` varchar(50) DEFAULT NULL,\par
\tab `obs` text,\par
\tab `datacadastro` varchar(50) DEFAULT NULL,\par
\tab `horacadastro` varchar(50) DEFAULT NULL,\par
\tab `dataalteracao` varchar(50) DEFAULT NULL,\par
\tab `horaalteracao` varchar(50) DEFAULT NULL,\par
\tab `operador` varchar(50) DEFAULT NULL,\par
\tab `cel_operador` varchar(50) DEFAULT NULL,\par
\tab `email_operador` varchar(50) DEFAULT NULL,\par
\tab `estabelecimento` varchar(50) DEFAULT NULL,\par
\tab `cidade_estabelecimento` varchar(50) DEFAULT NULL,\par
\tab `tel_estabelecimento` varchar(50) DEFAULT NULL,\par
\tab `email_estabelecimento` varchar(50) DEFAULT NULL,\par
\tab `operador_alterou` varchar(50) DEFAULT NULL,\par
