\tab `estabelecimento_alterou` varchar(50) DEFAULT NULL,\par
\tab `cidade_estabelecimento_alterou` varchar(50) DEFAULT NULL,\par
\tab `tel_estabelecimento_alterou` varchar(50) DEFAULT NULL,\par
\tab `email_estabelecimento_alterou` varchar(50) DEFAULT NULL,\par
\tab `motivo_exclusao` text,\par
\tab `dataexclusao` varchar(50) DEFAULT NULL,\par
\tab `horaexclusao` varchar(50) DEFAULT NULL,\par
\tab `operador_atendente` varchar(50) DEFAULT NULL,\par
