-- Estrutura da Tabela `historico_de_alteracoes_modelos` \par
--\par
\par
DROP TABLE IF EXISTS `historico_de_alteracoes_modelos`;\par
CREATE TABLE `historico_de_alteracoes_modelos` (\par
\tab `codigo_alteracao` int(11) NOT NULL AUTO_INCREMENT,\par
\tab `codigo_modelo` varchar(50) NOT NULL,\par
\tab `modelo` varchar(50) DEFAULT NULL,\par
\tab `preco_empresa` varchar(50) DEFAULT NULL,\par
\tab `preco_pespontador` varchar(50) DEFAULT NULL,\par
\tab `preco_coladeira1` varchar(50) DEFAULT NULL,\par
\tab `preco_coladeira2` varchar(50) DEFAULT NULL,\par
\tab `operador` varchar(50) NOT NULL,\par
\tab `dia` varchar(50) NOT NULL,\par
\tab `mes` varchar(50) NOT NULL,\par
\tab `ano` varchar(50) NOT NULL,\par
\tab `hora` varchar(50) NOT NULL,\par
\tab `dia_alteracao` varchar(50) NOT NULL,\par
\tab `mes_alteracao` varchar(50) NOT NULL,\par
\tab `ano_alteracao` varchar(50) NOT NULL,\par
\tab `data_alteracao` date NOT NULL,\par
\tab `hora_alteracao` varchar(50) NOT NULL,\par
\tab `percentual` varchar(50) NOT NULL,\par
\tab `historico` text NOT NULL,\par
\tab `nivel_dificuldade` varchar(50) NOT NULL,\par
\tab PRIMARY KEY (`codigo_alteracao`)\par
) ENGINE=MyISAM AUTO_INCREMENT=558 DEFAULT CHARSET=latin1;\par
\par
